  /vbeta1/validate/pf-imagem:
    post:
      tags:
        - Individual
        - Biometria
      summary: Validação das informações básicas de uma pessoa física e a biometria da face e das impressões digitais correspondentes
      description: |-
        Permite a validação entre a foto da face e as fotos das impressões digitais de uma pessoa física (objeto <code>key</code>) com a foto da face e as fotos das impressões digitais dessa pessoa armazenada nas bases de dados do governo. Esse recurso denominado pode ser utilizado para validar remotamente a identidade de uma pessoa.

        Para realizar a Biometria Digital e Facial, utiliza-se respectivamente os atributos <code>digitais</code> e <code>biometria_face</code> dentro do objeto <code>answer</code> uma String com a foto da face e/ou uma ou mais fotos das impressões digitais codificadas com <a href='https://pt.wikipedia.org/wiki/Base64' target='_blank'>Base64</a>.

        As imagens das digitais enviadas devem corresponder aos dedos das de acordo com o seguinte índice:

        <table><thead><tr><th><b>Posição</b></th><th><b>Dedo correspondente</b></th></tr></thead><tbody><tr><td>0</td><td>polegar da mão direita</td></tr><tr><td>1</td><td>indicador da mão direita</td></tr><tr><td>2</td><td>dedo médio da mão direita</td></tr><tr><td>3</td><td>dedo anelar da mão direita</td></tr><tr><td>4</td><td>dedo mínimo da mão direita</td></tr><tr><td>5</td><td>polegar da mão esquerda</td></tr><tr><td>6</td><td>indicador da mão esquerda</td></tr><tr><td>7</td><td>dedo médio da mão esquerda</td></tr><tr><td>8</td><td>dedo anelar da mão esquerda</td></tr><tr><td>9</td><td>dedo mínimo da mão esquerda</td></tr></tbody></table>

        A biometria não é um recurso determinístico, então cabe ao usuário utilizador do serviço utilizar os valores retornados na resposta para decidir sobre a autenticidade da biometria enviada. De qualquer forma é importante citar que em testes realizados, em aproximadamente 99% das validações que retornaram alta ou altíssima probabilidade, o par de biometria comparadas eram da mesma pessoa.

        Para os dados do tipo texto, também são retornados o percentual de similaridade entre o dado enviado e o dado oficial disponível nas bases do governo.
      operationId: pfImagem
      parameters:
        - name: x-request-trace-id
          in: header
          description: 'Este atributo pode ser usado para que o cliente possa rastrear suas requisições, incluindo neste um número de identificação (UUID) para a operação. Ao utilizar este parâmetro, o cabeçalho da resposta vem com o campo x-request-trace-id com o mesmo número enviado na requisição.'
          schema:
            type: string
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/PFBiometriaValidateInput'
            example:
              key:
                cpf: '33840981026'
              answer:
                biometria_face: 
                digitais:
                  - posicao: 0
                    formato: JPG
                    imagem: 
                nome: João
                sexo: M
                filiacao:
                  nome_mae: Mãe do João
                  nome_pai: Pai do João
                nacionalidade: 1
                documento:
                  tipo: 1
                  numero: '000001'
                  orgao_expedidor: SSP
                  uf_expedidor: MG
                cnh:
                  numero_registro: '0000001'
                  categoria: AB
                  registro_nacional_estrangeiro: '123456'
                  data_primeira_habilitacao: '2000-10-10'
                  data_validade: '2000-10-10'
                endereco:
                  logradouro: Nome do Logradouro
                  numero: '0007'
                  complemento: APTO 2015
                  bairro: Nome do Bairro
                  cep: '0000001'
                  municipio: Nome do municipio
                  uf: DF
                data_nascimento: '2000-10-10'
                situacao_cpf: regular
        required: true
      responses:
        '200':
          description: Bleh
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/PFBiometriaResult'
        '400':
          description: Requisição inválida - A requisição não foi aceita pois existe alguma iconsistência em algum campo da requisição. Confira se as propriedades do corpo da requisição estão de acordo com a propriedades esperadas pelo método e se corpo da requisição está codificado em UTF-8.
        '401':
          description: Não autenticado - Problemas durante a autenticação.
        '403':
          description: Não autorizado - Acesso não autorizado.
          content:
            application/xml: {}
        '413':
          description: Request Entity Too Large - A requisição tem um tamanho muito grande. Verifique se o limite de tamanho máximo da requisição está sendo atendido.
        '422':
          description: |-
            Validação não processada - A validação não pode ser processada por que algum valor inválido foi enviado na requisição. Os valores inválidos são listadas na resposta.

            <table><thead><tr><td><b>code</b></td><td><b>property</b></td><td><b>message</b></td></tr></thead><tbody><tr><td>DV10</td><td>key.cpf</td><td>CPF {key.cpf} inválido</td></tr><tr><td>DV15</td><td>key.cpf</td><td>CPF {key.cpf} não foi encontrado</td></tr><tr><td>DV11</td><td>answer.nacionalidade</td><td>Valor inválido</td></tr><tr><td>DV12</td><td>answer.documento.tipo</td><td>Valor inválido</td></tr><tr><td>DV13</td><td>answer.sexo</td><td>Valor inválido</td></tr><tr><td>DV14</td><td>answer.situacao_cpf</td><td>Valor inválido</td></tr><tr><td>DV20</td><td>key.cnpj</td><td>CNPJ {key.cnpj} inválido</td></tr><tr><td>DV23</td><td>key.cnpj</td><td>CNPJ {key.cnpj} não foi encontrado</td></tr><tr><td>DV21</td><td>answer.situacao_cadastral.codigo</td><td>Valor inválido</td></tr><tr><td>DV22</td><td>answer.porte</td><td>Valor inválido</td></tr><tr><td>DV41</td><td>biometria_face</td><td>Não foi possível reconhecer a face na imagem</td></tr><tr><td>DV42</td><td>biometria_face</td><td>Resolução da imagem inválida</td></tr><tr><td>DV43</td><td>biometria_face</td><td>Imagem corrompida ou fora do formato JPG, JPEG ou PNG</td></tr></tbody></table>
